import React from 'react';
import { Table } from "reactstrap";

const Footer = () => {
    return (
        <footer className="py-5 bg-dark">
            <div className="container">
                <p className="m-0 text-center text-white">Copyright &copy; Aplicação 2021</p>
            </div>
        </footer>
    )
}
export default Footer;
